graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  subgraph cluster_OrderWorkflow {
    label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>OrderWorkflow</b> <i>&lt;process&gt;</i> <i>@Version("2.0")</i></td></tr><tr><td align="center"><b>Order Processing</b></td></tr></table>>;
    labelloc="t";
    style=filled;
    fontsize=10;
    fillcolor="#FFFFFF";
    color="#999999";
    "OrderWorkflow__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

    "Received" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Received</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Order received</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
    "Processing" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Processing</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Processing order</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
    "Completed" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Completed</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Order completed</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
    "Failed" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Failed</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Order failed</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  }

  // Edges
  "Received" -> "Processing" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Processing" -> "Completed" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Processing" -> "Failed" [labelOverlay="75%", labelhref="#srcLineTBD"];
}
